Auto sprawne technicznie na bieżąco serwisowane.Silnik suchy ,ma moc,nie bierze oleju.Skrzynia cicha -dobrze wybiera biegi.Środek dobrze wygląda.Auto wizualnie b.ładne bez korozji.Opony zima+lato.

To dobry samochód-polecam.Gwarancja 3-miesięczna.Zapraszam na oględziny i jazdę próbną

Dzień dobrym, mam do sprzedania samochód osobowy marki Citroen Xsara Picasso wyprodukowany w 2005 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1997 cm3, legitymujący się mocą 90 KM, który pokonał do tej pory 214000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Citroen prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji, progi i podloga w bardzo dobrym stanie.  Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane, komfortu dodaje sprawna chłodząca klimatyzacja, oraz sprany, odsuwający się szklany dach.



Xsara jest wyposażenia w:

- Klimatyzacje automatyczna;

- Panoramiczny dach;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie i tylne;

- Elektryczne lusterka;

- 4 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 11.09.2025 roku.

